import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import Register from './registration/register';
import Login from './login/login';
import Profile from './profile/profile';

function App() {
  return (
    <Router>
      <Switch>

        <Route exact path='/' >
          <Login/>
        </Route>
        <Route path='/reg' >
          <Register/>
        </Route>
        <Route path='/profile' >
          <Profile/>
        </Route>

      </Switch>
    </Router>
  );
}

export default App;
